import PropTypes from 'prop-types';

class ToDoItem extends Component {
  render() {
    return (
      <div className="ToDo">
        <strong>{this.props.todo.title}</strong>
      </div>
    );
  }
}

{/*This is just a validation for the data type of the stuff in this file, e.g. this checks that the 'todo' array is in fact an array: */}
